import React from 'react';
import style from './Post.module.css';
function Post(props) {
  const post = {
    imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
    groupName: 'Group Name',
    dataPost: 'Data Post',
    description: 'Description',
    imagePost: 'Image Post',
    amountLike: 12,
    amountPost: 15,
    amountReposts: 8,
  };
  return (
    <div className={style.main}>
      <div className={style.group_name}>
        <img className={style.image_group} src={post.imageGroup} alt="group image" />
        <div className={style.group_description}>
          <div>{post.groupName}</div>
          <div>{post.dataPost}</div>
        </div>
      </div>
      <div>
        <div className={style.post_description}>Description</div>
        <img className={style.post_image} src={post.imagePost} alt="post image" />
      </div>
      <div className={style.group_like}>
        <div className={style.like}>Like 12</div>
        <div className={style.like}>Comments 15</div>
        <div>Reposts 8</div>
      </div>
    </div>
  );
}

export default Post;
